import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NormalCar from './components/NormalCar';
import { SportyCar } from './components/SportyCar';
import { LuxeCar } from './components/LuxeCar';
import Truck from './components/Truck';
import FamilyCar from './components/FamilyCar';
import { useState, useEffect } from 'react';
import { CarsContext } from './CarsContext';
import { CONSTANTS } from './Contant';
import { FuelType, AbstractCar } from './models';
import CarTypeForm from './components/CarTypeForm';

interface ContextType {
  car?: AbstractCar;
}
function App() {

  const [data, setDataInner] = useState<ContextType>();

  const setData = (data: React.SetStateAction<ContextType | undefined>) => {
    setDataInner(data);
  };

  return (
    <div className="App">
      <BrowserRouter>
        <CarsContext.Provider value={{ data, setData }}>          
          <Routes>
            <Route path="/" element={<CarTypeForm/>}> 
            </Route>
            <Route path="/selecteer-motorblok">
            </Route>
            <Route path="/selecteer-deuren">
            </Route>
          </Routes>
        </CarsContext.Provider>
      </BrowserRouter>
    </div>
  );
}

export default App;
